import { TabBar } from 'antd-mobile';
import React,{Component}from 'react'
import NavHeader from '@/components/common/NavHeader'
import {mainPageMap,mainTypeMatch}from '@/plugins/libs/mainMap'
import {routerMatch}from '@/plugins/libs/routerMap'
class Main extends Component{
  constructor(...args) {
    super(...args);
    this.state = {
      selectedTab: 'home'
    };
  }
  componentDidMount(){
    console.log(this.props.match)
    this.setState({
      selectedTab:mainTypeMatch(this.props.match.params.type).type
    })
  }
  render(){
    return (
      <div className="qm-main-page">
        <NavHeader title={routerMatch(this.props.match.path).name}/>
      <div style={{width:"100%",height:'100px',background:"red",marginBottom}}></div>
      </div>
    )
  }
};

export default Main;
